PLOT: 
Evil wreaks pure havoc and bloody murder upon Leslie Van Hooten, a beautiful young girl, and her unsuspecting fellow grad students as they make their way to her family's extravagant and yet isolated estate. Peter (Bill Moseley- Texas Chainsaw Massacre 3D, House of 1000 Corpses) and Irene Van Hooten (Leslie Easterbrook- The Devil's Rejects, Police Academy), the young girl's mother and father, leave the group alone for the weekend, so that she may mourn the anniversary of her boyfriend's shocking murder. But the peaceful weekend soon turns to hell when they find themselves being savagely terrorized by Cliff Rifton (Allan Kayser- Night of the Creeps, TV's Mama's Family), a crazed and recently released career criminal, and Buzz Schenk, his drug addict side kick whom are hell bent on raging a torturous killing spree. But as the horrifying acts begin to unfold, the killers soon realize all is not as it seems in this house. And when some strange people from the neighborhood show up, Rose (Dyanne Thorne- Ilsa She Wolf of the SS) and Emmett (Howard Maurer- Ilsa Harem Keeper of the Oil Sheiks), the tables are turned. Now everyone is trapped inside and as the unheard screams and the body count begins to rise, it seems that death is now the only real escape from the &quot;House of the Witch Doctor&quot;.              

